import React from "react";
import { RouteComponentProps } from "react-router-dom";
import {
  GivePage,
  MailPage,
  NotePage,
  OrganizePage,
  ReadPage,
  WritePage,
} from "./ProductPages";
import Props from "./ProductPages/interface";

interface MatchParams {
  type: string;
}
interface Prop extends RouteComponentProps<MatchParams> {}

const Products: React.FC<Prop> = ({ match }) => {
  let productType: string = match.params.type;
  let productTypeComponent: React.FC<Props> = <MailPage />;
  switch (productType) {
    case "give":
      productTypeComponent = <GivePage />;
      break;
    case "mail":
      productTypeComponent = <MailPage />;
      break;
    case "notes":
      productTypeComponent = <NotePage />;
      break;
    case "write":
      productTypeComponent = <WritePage />;
      break;
    case "read":
      productTypeComponent = <ReadPage />;
      break;
    case "organize":
      productTypeComponent = <OrganizePage />;
      break;
  }
  return <div>{productTypeComponent}</div>;
};

export default Products;
